import React from 'react';
import EightBall from './components/EightBall';
import ColorBoxes from './components/ColorBoxes';
import './App.css';

function App() {
  const answers = [
    { msg: "It is certain." },
    { msg: "It is decidedly so." },
    { msg: "Without a doubt." },
    { msg: "Yes – definitely." },
    { msg: "You may rely on it." },
    { msg: "As I see it, yes." },
    { msg: "Most likely." },
    { msg: "Outlook good." },
    { msg: "Yes." },
    { msg: "Signs point to yes." },
    { msg: "Reply hazy, try again." },
    { msg: "Ask again later." },
    { msg: "Better not tell you now." },
    { msg: "Cannot predict now." },
    { msg: "Concentrate and ask again." },
    { msg: "Don't count on it." },
    { msg: "My reply is no." },
    { msg: "My sources say no." },
    { msg: "Outlook not so good." },
    { msg: "Very doubtful." }
  ];

  return (
    <div className="App">
      <EightBall answers={answers} />
      <ColorBoxes />
    </div>
  );
}

export default App;
